    <h2 className="form-headline">Send us a message</h2>
    {/* <form id="submit-form" action=""> */} <br /><br />
    <form ref={form} onSubmit={sendEmail}>
      <p>
        <input id="name" className="form-input" type="text" name="from_name" placeholder="Your Name*"/>
        <small className="name-error"></small>
      </p>
      <p>
        <input id="email" className="form-input" type="email" name="user_email" placeholder="Your Email*"/>
